VALUES(NOMBRES,APEPAT,APEMAT,DIRECCION,MOVIL,SEXO,FECHANACIMIENTO,NRODOCUMENTO,COLEGIATURA,ESPECIALIDAD,(SELECT MAX(usu_id) FROM usuario));
SELECT 1;
ELSE

SELECT 2;

END IF;
ELSE
SELECT 2;
END IF;


END$$

