INSERT INTO `cita` (`cita_id`, `cita_nroatencion`, `cita_feregistro`, `medico_id`, `paciente_id`, `cita_estatus`, `cita_justificacion`, `cita_nacional`, `cita_descripcion`, `cita_departamental`, `cita_descripcion1`, `cita_municipal`, `cita_descripcion2`, `cita_alcance`, `cita_especificos`, `cita_productos`, `cita_presupuesto`, `cita_nombre`, `cita_sector`, `cita_descripcion5`, `cita_fuente`, `usuario_id`) VALUES
(18, 1, '2021-08-07', NULL, NULL, 'ACTIVO', 'Es innegable la acelerada y vertiginosa evolución de los recursos tecnológicos a disposición de la humanidad para mejorar su calidad de vida en múltiples aspectos; esta dinámica, a su vez, crea la necesidad de impulsar el desarrollo en los distintos ámbitos de la vida social y económica de las personas. Las nuevas tecnologías ponen de presente dinámicas y procesos emergentes que tienen por objetivo la articulación de estas herramientas para el mejoramiento continuo de aspectos tan diversos como la vida laboral, la producción artística y cultural y, por supuesto, la educación.\n\nLa creciente disponibilidad de nuevas herramientas tecnológicas al servicio de los procesos formativos se ha convertido en un gran aliado para la transformación y superación de los enfoques pedagógicos tradicionales, y brinda un enorme potencial para la definición de nuevos roles en la educación. Sin embargo, el aprovechamiento de estas nuevas posibilidades requiere de un gran esfuerzo de alfabetización digital que permita que los distintos actores de la comunidad educativa puedan potenciar la calidad de los procesos de enseñanza y aprendizaje.\n\nPara mejorar la calidad educativa de cara a las competencias del siglo XXI, es necesario que el desarrollo de nuevas tecnologías digitales desempeñe un papel protagónico en los procesos de innovación, y en la capacidad de los distintos miembros de la comunidad educativa (estudiantes, docentes, directivos y padres de familia, entre otros) para integrar las nuevas herramientas al proceso formativo. El proceso de la innovación educativa debe dar paso a una redefinición de los roles tradicionales que ayuden a superar la unidireccionalidad docente-estudiante, permitiendo que estos últimos tengan un papel más activo en sus dinámicas de aprendizaje, y que sean capaces de generar competencias que vayan más allá de la obtención pasiva de conocimiento; estos procesos, buscan incentivar el desarrollo del pensamiento y el análisis crítico, la capacidad de resolución de problemas y el aprendizaje aplicado.\nTeniendo presente la importancia del avance en la adquisición de competencias tecnológicas y digitales en el país, se diseñó en el año 2000 el programa nacional Computadores para Educar -CPE-, con el objetivo de incrementar la disponibilidad y el acceso a terminales de cómputo en las sedes educativas oficiales, así como mejorar el nivel de apropiación de estas tecnologías por parte de la comunidad educativa (Departamento Nacional de Planeación - DNP, 2020). La implementación de este programa tuvo un impacto significativo en el mejoramiento de la permanencia educativa, al tiempo que aumentó la disponibilidad de terminales de cómputo por estudiante y acompañó procesos de apropiación a los docentes de los establecimientos educativos oficiales beneficiados con el programa.\nSin embargo, tras 20 años de implementación del programa CPE, los resultados evidencian que aún existe una gran proporción de sedes educativas oficiales que no fueron dotadas con el programa, al tiempo que las terminales entregadas en las etapas iniciales de la estrategia han iniciado su transición hacia la obsolescencia.  Al mismo tiempo, el diagnóstico de la estrategia da cuenta de la baja integración de la planta docente a los procesos de apropiación de las herramientas tecnológicas, ya que poco más del 40% de los mismos recibió formación pertinente para el aprovechamiento de las nuevas herramientas. Así, la dotación tecnológica y los procesos de apropiación se han quedado a medio camino en la consecución del objetivo último de impulsar el mejoramiento de la calidad educativa (Departamento Nacional de Planeación - DNP, 2020).\nResulta claro, a la luz de la experiencia, que la inversión en disponibilidad de equipos y herramientas tecnológicas no es capaz por si sola de impulsar el desarrollo de la innovación y, en consecuencia, de mejorar la calidad educativa para generar egresados cada vez más críticos y competitivos (OEI, 2018). Es necesario, además, que los procesos formativos de los docentes no se vean limitados simplemente a la apropiación del uso y funcionamiento de una herramienta nueva, sino que requieren tener competencias que les permitan proponer estrategias pedagógicas, metodologías y enfoques de clase y evaluación que aprovechen al máximo el uso de las tecnologías como parte de la formación de competencias.\nDe acuerdo con la Organización de las Naciones Unidas para la Educación, la Ciencia y la Cultura – UNESCO, los grandes avances tecnológicos que se presenten en los próximos diez años incidirán de forma directa en aspectos de la vida misma como la agricultura, la salud y la educación, así como en las formas de trabajo y el mercado laboral per se (UNESCO, 2018). Así pues, la construcción de paz a través de la escuela no es ajena a esta situación, y para ello, el fortalecimiento de las competencias digitales está estrechamente relacionado. En primer lugar, para promover la construcción de paz se hace necesario mejorar las relaciones entre personas de una institución, promoviendo la transición desde relaciones marcadas por la violencia y la agresión hacia relaciones marcadas por una cultura de paz; esto implica que, valores como el reconocimiento de las libertades, el respeto de los derechos humanos y la tolerancia, sean incorporados en el entorno educativo para que, a su vez, este ambiente se traduzca en buenas prácticas y mejoría de competencias ciudadanas. \nComo se mencionó, este proceso puede ser ir de la mano con el incremento de competencias digitales, que son un instrumento del cambio positivo tanto en la dimensión social como en el desarrollo cultural. Más aún, “las TIC presentan diversos beneficios tras su implementación, uno de ellos es que amplían las posibilidades de comunicación, afianzando los vínculos afectivos en los ámbitos en que se utilicen, posibilitando de esta forma el desarrollo de competencias ciudadanas” (Cárdenas, Carrillo, Mazuera, &amp; Hernández, 2018, pág. 233). Por otro lado, para Belalcázar y Molina (2017), la utilización de recursos TIC por parte de los docentes, fortalecen las estrategias de respuesta a necesidades de convivencia, ya que, “constituyen un gran aliado y complemento para la educación, además su correcta implementación puede favorecer los procesos de formación en convivencia y cultura de paz” (Cárdenas, Carrillo, Mazuera, &amp; Hernández, 2018, pág. 233).\nDe forma institucional, las competencias digitales son claves para la construcción de paz. Para el DQ Institute (2019), la posibilidad de promover sociedades pacíficas e inclusivas, en las que se genere acceso a la justicia y desarrollo sostenible para todos, consiste en empoderar a las comunidades mediante las competencias digitales; esto permite al mismo tiempo trabajar en pro de los indicadores de bienestar de la OCDE y el objetivo de desarrollo sostenible 16: paz, justicia e instituciones sólidas. De esta manera, es necesaria una correcta planificación que articule políticas públicas, planes de estudio, necesidades, filosofía pedagógica entre otros. \nPor otro lado, es necesario que los procesos de apropiación y formación a los docentes y directivos docentes vayan mucho más allá de la capacitación para el uso adecuado de una herramienta nueva, ya que, esto limita fuertemente la capacidad del docente para aprovechar efectivamente la nueva disponibilidad de recursos en sus programas y actividades; es necesario que los procesos de formación busquen en primer lugar definir una base común de competencias digitales en la planta docente como punto de partida, pero también que sean procesos pertinentes para los contextos territoriales, en vez de una formación estándar que muchas veces resulta ajena a las realidades en las cuales se implementa. Una ruta de formación efectiva deberá garantizar un nivel mínimo de competencias digitales que permitan mantener la continuidad de la prestación del servicio educativo, aún en contextos atípicos como la prestación en modalidades no presenciales durante la pandemia del COVID19.\nAdemás, será necesario que los docentes y directivos docentes incorporen capacidades relacionadas con las nuevas herramientas y recursos tecnológicos para integrarlos al diseño de sus currículos; competencias en robótica, programación, optimización, pensamiento de diseño y aulas virtuales, entre otros, serán claves para la transformación del papel del docente como parte del proceso formativo, y de la dinámica misma de los procesos de enseñanza y aprendizaje. Además, las inversiones deberán ser sostenibles y permitir el desarrollo de una capacidad instalada, que no esté atada al ejercicio de un docente en particular; por esta razón, la formación también debe generar elementos de gestión institucional que permitan a la comunidad educativa participar de manera activa en los procesos de diagnóstico y reformulación continua de los Proyectos Educativos Institucionales -PEI, de manera que esas iniciativas se institucionalicen efectivamente en las apuestas académicas y pedagógicas de los establecimientos educativos en el corto, mediano y largo plazo.\nEn reconocimiento de lo anterior, el Plan Decenal de Educación 2016 – 2026 elaborado por el Ministerio de Educación Nacional (2016) a partir de ejercicios participativos con la comunidad establece diez desafíos estratégicos para la educación en Colombia, el sexto desafío plantea el uso pertinente, pedagógico y generalizado de las nuevas y diversas tecnologías para apoyar la enseñanza, la construcción de conocimiento, el aprendizaje, la investigación y la innovación, fortaleciendo el desarrollo para la vida. Por otra parte, el Plan Nacional de Desarrollo “Pacto por Colombia, Pacto por la Equidad 2018 – 2022” establece en su Pacto por la Transformación Digital incrementar el acceso a las Tecnologías de la Información y Comunicación – TIC, y desarrollar estrategias que permitan integrar estas tecnologías en los territorios de modo que su uso adecuado permita generar mayor competitividad y desarrollo económico y social (Departamento Nacional de Planeación, 2018). Por su parte, el Ministerio Nacional de Educación presenta en su Plan Estratégico Institucional 2018 – 2022 un conjunto de siete objetivos a lograr en el cuatrienio, siendo el segundo objetivo Brindar una educación con calidad y fomentar la permanencia en la educación inicial, preescolar, básica y media, a través del cual se fomenta procesos de dotación de equipos y herramientas para los establecimientos educativos del país que permitan incrementar la calidad educativa y el acceso por parte de todos los niños, niñas y adolescentes; y se plantean iniciativas para la formación docente para un mejoramiento de los procesos de enseñanza (Ministerio de Educación Nacional, 2019).\nPor otra parte, cabe resaltar la importancia del Plan de Acción para la Transformación Regional (PATR), los cuales consisten en la implementación de una estrategia para la gestión y planificación que permite orientar la ejecución de actividades a realizar al interior de las Agencias de Renovación del Territorio (ART), conforme a los planes y objetivos estipulados en su línea estratégica.  Para el caso del departamento de Putumayo, este instrumento de planificación hace parte de la subregión Putumayo, que comprende los municipios de Leguizamo, Mocoa, Orito, Puerto Asís, Puerto Caicedo, Puerto Guzmán, San Miguel, Valle del Guamuez y Villa Garzón. Dentro de su esquema estratégico, se busca generar una serie de programas y proyectos encaminados a dar solución a situaciones que se han agravado en esta región en el marco del conflicto armado interno colombiano (Renovación del Territorio, 2018). Frente a este panorama, el PATR de la región incluye 8 pilares con los que se busca mejorar las condiciones de vida de los habitantes de estos municipios:\n1.	Ordenamiento social de la propiedad rural y uso del suelo\n2.	Infraestructura y adecuación de tierras\n3.	Salud rural\n4.	Educación rural y primera infancia rural\n5.	Vivienda rural, agua potable y saneamiento básico rural \n6.	Reactivación económica y producción agropecuaria\n7.	Sistema para la garantía progresiva del derecho a la alimentación\n8.	Reconciliación, convivencia y construcción de paz \nEn el marco de los PATR el proyecto contribuye al desarrollo de una iniciativa de la fase municipal del municipio de San Miguel perteneciente al pilar Educación rural y primera infancia rural, esta iniciativa se encuentran en la estrategia Cobertura, calidad y pertinencia de educación rural para preescolar, básica y media. De acuerdo con la naturaleza del proyecto, de acuerdo con su alcance, el proyecto se articula con la iniciativa: “Dotar de aulas inteligentes a los establecimientos educativos rurales del municipio de San Miguel en el departamento de Putumayo.”.\n\n', NULL, 'Estrategia plan nacional de desarrollo 2018-2022 “Pacto por Colombia, pacto por la equidad”.\nPrograma: 2201- Calidad, cobertura y fortalecimiento de la educación inicial, prescolar, básica y media.\nPacto: 3003 - III. Pacto por la equidad: política social moderna centrada en la familia, eficiente, de calidad y conectada a mercados.\nLínea: 300303 - 3. Educación de calidad para un futuro con oportunidades para todos.', NULL, 'Estrategia Plan de desarrollo departamental 2020 – 2023 “Trece municipios un solo corazón”.\nLínea estratégica: Social.\nSector: Educación.\nPrograma: Calidad educativa.\nObjetivo: Mejorar la calidad del servicio educativo en educación escolar, básica y media.', NULL, 'Estrategia Plan de desarrollo territorial 2020-2023 “Ahora si, unidos por San Miguel – Territorio de Frontera”.\nPrograma: Proyectos integrales de ciencia, tecnología e innovación.\nSubprograma: Ciencia y tecnología.\nObjetivo: Aumentar las capacidades de innovación y desarrollo tecnológico. ', 'Mejorar ambientes digitales en los Establecimientos Educativos Oficiales de la zona rural del municipio de San Miguel.', 'Objetivos específicos No.1.\nAumentar competencias en docentes y directivos docentes para el uso de herramientas tecnológicas en el proceso formativo.\nObjetivo específico No. 2.\nIncrementar el acceso a recursos tecnológicos adecuados en los Establecimientos Educativos Oficiales.', 'Producto No. 1. \nServicios de fortalecimiento a las capacidades de los docentes de educación inicial, preescolar, básica y media\n\nProducto No. 2. \nInfraestructura educativa dotada.\n\n', '5,436,224.737.00', ' Mejoramiento de ambientes digitales en establecimientos educativos oficiales de la zona rural del municipio de San Miguel', 'EDUCACIÓN', 'El proyecto propone el desarrollo de un diplomado que beneficiaría a 159 docentes y directivos docentes pertenecientes a 49 sedes educativas que hacen presencia en la zona rural del municipio, a través de una serie de clases magistrales y virtuales que permiten incrementar las capacidades de los docentes respecto al uso de nuevas tecnologías que le faciliten el proceso pedagógico y mejoren la enseñanza para los estudiantes a partir de las siguientes actividades: Implementar el programa de formación docente Diplomado para fortalecer las competencias digitales para la innovación educativa; Suministrar recursos tecnológicos a las sedes educativas oficiales para el desarrollo de ambientes innovadores.\nEl diplomado tendrá una intensidad de 147 horas de las cuales, 97 serán en modalidad virtual y se ejecutarán en 14 jornadas de 6 horas,1 jornada de 4 horas y 9 talleres de 1 hora. Por otra parte, 50 horas se dictarán en modalidad presencial y se ejecutarán en 10 jornadas de 5 horas. Este diplomado está conformado por 4 módulos y 8 unidades temáticas: Introducción a las herramientas básicas de computación; Competencias digitales para la educación del siglo XXI; Metodologías de enseñanza y aprendizaje para la innovación educativa; Investigación y generación de conocimiento desde el enfoque STEM (Ciencia, tecnología, ingeniería y matemáticas) / STEAM (Ciencia, tecnología, ingeniería, arte y matemáticas). En complemento a lo anteriormente expuesto, se propone dotar de herramientas tecnológicas a las 46 sedes educativas ubicadas en la zona rural del municipio, con el fin de facilitar los procesos pedagógicos en los niveles de básica primaria, secundaria y media; entre los materiales dispuestos para la dotación se encuentran tabletas, computadores (portátiles o de escritorio) y tableros interactivos. Esta dotación se entregará a través de Kits Tecnológicos.\n', 'El proyecto será financiado con recursos provenientes del Sistema General de Regalías – SGR, a través del fondo de Asignación para la paz.', 1),
(19, 1, '2021-08-08', NULL, NULL, 'ACTIVO', 'El 25% de la población del departamento del Meta se encuentra en un rango entre los 14 y 28 años. Los jóvenes constituyen un segmento poblacional de importancia estratégica para el desarrollo económico de países en vías de desarrollo. Esto en sociedades como Colombia, donde el desempleo juvenil para el primer trimestre del 2021 fue del 23,9%, representa la necesidad de políticas gubernamentales que en el corto y mediano plazo sean respuestas asertivas a la eliminación de barreras para el desarrollo económico de los sectores más vulnerables de la sociedad, partiendo de una base orientada al mejoramiento de capacidades productivas. Los jóvenes en condiciones de vulnerabilidad tienden a tener bajos niveles de formación y atrasos en el desarrollo de capacidades productivas, que de manera conjunta forman barreras para el acceso al mercado financiero legal en condiciones competitivas que finalmente impide mayores tasas de éxito al momento de emprender.\nFrente a esta problemática y en concordancia con la política pública de emprendimiento a nivel nacional, contemplada en la Ley 2069 de 2020, y con la política publica del departamento del Meta, creada mediante la Ordenanza No. 1023 de 2019, el proyecto permite contribuir al cumplimiento del objetivo específico de esta política pública departamental que es Promover una cultura permanente de emprendimiento en el departamento para fortalecer la actividad productiva.\n\n', NULL, 'Plan de desarrollo nacional	Pacto por Colombia Pacto por la Equidad 2018-2022\nPacto	Pacto por el emprendimiento, la formalización y la productividad: una economía dinámica, incluyente y sostenible que potencie todos nuestros talentos.\nLínea	A. Entrono para crecer: formalización, emprendimiento y dinamización empresarial.\nObjetivo	Objetivo 1. Desarrollar una mentalidad, cultura y otros habilitantes del emprendimiento.\n', NULL, 'Alineación estratégica nivel departamental.\nPlan de desarrollo departamental	Hagamos Grande al Meta 2020-2023\nDimensión 	Dimensión 3. Hagamos grande al Meta en lo social\nSector	Sector 41. Inclusión social\nPrograma	4103 – Programa 3. Inclusión social y productiva para la población en situación de vulnerabilidad.\nMeta	Realizar una estrategia para promover la asociatividad, el fortalecimiento y la cofinanciación de proyectos productivos y de emprendimiento juvenil urbanos y rurales en el departamento del Meta.\n', NULL, 'El proyecto se articula con los planes de desarrollo territorial de cada uno de los municipios que conforman el departamento del Meta. El proyecto se articula con programas del sector educación contenidos en estos instrumentos de planeación, contribuyendo al cumplimiento de las metas de cada programa. ', 'Fortalecer capacidades productivas y empresariales de la población joven vulnerable en el departamento del Meta.', 'Objetivo específico No. 1.\nGenerar competencias empresariales en la población joven emprendedora del departamento del Meta.\nObjetivo especifico No. 2.\nFortalecer unidades productivas de los jóvenes emprendedores del departamento del Meta para su sostenibilidad y consolidación como medio de vida.\n', '1.1. Plan de medios.	2.1. Programa formativo.	3.1. Modelos de negocio.\n\n3.2. Branding de emprendimientos.	4.1. Informe de entrega de capital en especie a 400 emprendedores.	5.1. Evento de asociatividad.	6.1. Informe de acompañamiento psicosocial a jóvenes emprendedores.\n\n6.2. Informe de monitoreo y seguimiento a unidades productivas.\n', '20,000,000.00', 'Mi META es emprender', 'GOBIERNO TERRITORIAL', 'El proyecto Mi META es emprender, es una iniciativa que busca fortalecer mediante un proceso formativo, entrega de capital en especie y mediante actividades de asociatividad empresarial, las capacidades emprendedoras de 600 jóvenes metenses entre 18 y 28 años en condición de vulnerabilidad de los 29 municipios del departamento. Mediante un programa formativo tipo diplomado, acompañamiento profesional, dotación de unidades productivas a 600 jóvenes emprendedores, y networking empresarial, el proyecto fortalecerá el tejido emprendedor de los jóvenes del Meta, contribuyendo a la consolidación y estabilización de sus iniciativas productivas. El incentivo económico, representado en dotación física y encadenamientos comerciales, establece un valor de hasta $15.000.000 millones de pesos por joven beneficiado.  El tipo de dotación a realizar será el resultado de un proceso de acompañamiento profesional permanente y acorde a la estructura de la iniciativa de emprendimiento propuesta y aprobada por cada joven. El proyecto priorizará 35% emprendimientos de la población juvenil rural y un 65% de la población joven de la zona urbana de los municipios del Meta. El proyecto tendrá un periodo de ejecución de 12 meses.', 'El proyecto será financiado con recursos provenientes del Sistema del Sistema General de Regalías – SGR, del fondo de Asignaciones directas del departamento. ', 1),
