el análisis crítico, la capacidad de resolución de problemas y el aprendizaje aplicado.\nTeniendo presente la importancia del avance en la adquisición de competencias tecnológicas y digitales en el país, se diseñó en el año 2000 el programa nacional Computadores para Educar -CPE-, con el objetivo de incrementar la disponibilidad y el acceso a terminales de cómputo en las sedes educativas oficiales, así como mejorar el nivel de apropiación de estas tecnologías por parte de la comunidad educativa (Departamento Nacional de Planeación - DNP, 2020). La implementación de este programa tuvo un impacto significativo en el mejoramiento de la permanencia educativa, al tiempo que aumentó la disponibilidad de terminales de cómputo por estudiante y acompañó procesos de apropiación a los docentes de los establecimientos educativos oficiales beneficiados con el programa.\nSin embargo, tras 20 años de implementación del programa CPE, los resultados evidencian que aún existe una gran proporción de sedes educativas oficiales que no fueron dotadas con el programa, al tiempo que las terminales entregadas en las etapas iniciales de la estrategia han iniciado su transición hacia la obsolescencia.  Al mismo tiempo, el diagnóstico de la estrategia da cuenta de la baja integración de la planta docente a los procesos de apropiación de las herramientas tecnológicas, ya que poco más del 40% de los mismos recibió formación pertinente para el aprovechamiento de las nuevas herramientas. Así, la dotación tecnológica y los procesos de apropiación se han quedado a medio camino en la consecución del objetivo último de impulsar el mejoramiento de la calidad educativa (Departamento Nacional de Planeación - DNP, 2020).\nResulta claro, a la luz de la experiencia, que la inversión en disponibilidad de equipos y herramientas tecnológicas no es capaz por si sola de impulsar el desarrollo de la innovación y, en consecuencia, de mejorar la calidad educativa para generar egresados cada vez más críticos y competitivos (OEI, 2018). Es necesario, además, que los procesos formativos de los docentes no se vean limitados simplemente a la apropiación del uso y funcionamiento de una herramienta nueva, sino que requieren tener competencias que les permitan proponer estrategias pedagógicas, metodologías y enfoques de clase y evaluación que aprovechen al máximo el uso de las tecnologías como parte de la formación de competencias.\nDe acuerdo con la Organización de las Naciones Unidas para la Educación, la Ciencia y la Cultura – UNESCO, los grandes avances tecnológicos que se presenten en los próximos diez años incidirán de forma directa en aspectos de la vida misma como la agricultura, la salud y la educación, así como en las formas de trabajo y el mercado laboral per se (UNESCO, 2018). Así pues, la construcción de paz a través de la escuela no es ajena a esta situación, y para ello, el fortalecimiento de las competencias digitales está estrechamente relacionado. En primer lugar, para promover la construcción de paz se hace necesario mejorar las relaciones entre personas de una institución, promoviendo la transición desde relaciones marcadas por la violencia y la agresión hacia relaciones marcadas por una cultura de paz; esto implica que, valores como el reconocimiento de las libertades, el respeto de los derechos humanos y la tolerancia, sean incorporados en el entorno educativo para que, a su vez, este ambiente se traduzca en buenas prácticas y mejoría de competencias ciudadanas. \nComo se mencionó, este proceso puede ser ir de la mano con el incremento de competencias digitales, que son un instrumento del cambio positivo tanto en la dimensión social como en el desarrollo cultural. Más aún, “las TIC presentan diversos beneficios tras su implementación, uno de ellos es que amplían las posibilidades de comunicación, afianzando los vínculos afectivos en los ámbitos en que se utilicen, posibilitando de esta forma el desarrollo de competencias ciudadanas” (Cárdenas, Carrillo, Mazuera, &amp; Hernández, 2018, pág. 233). Por otro lado, para Belalcázar y Molina (2017), la utilización de recursos TIC por parte de los docentes, fortalecen las estrategias de respuesta a necesidades de convivencia, ya que, “constituyen un gran aliado y complemento para la educación, además su correcta implementación puede favorecer los procesos de formación en convivencia y cultura de paz” (Cárdenas, Carrillo, Mazuera, &amp; Hernández, 2018, pág. 233).\n\n\nDe forma institucional, las competencias digitales son claves para la construcción de paz. Para el DQ Institute (2019), la posibilidad de promover sociedades pacíficas e inclusivas, en las que se genere acceso a la justicia y desarrollo sostenible para todos, consiste en empoderar a las comunidades mediante las competencias digitales; esto permite al mismo tiempo trabajar en pro de los indicadores de bienestar de la OCDE y el objetivo de desarrollo sostenible 16: paz, justicia e instituciones sólidas. De esta manera, es necesaria una correcta planificación que articule políticas públicas, planes de estudio, necesidades, filosofía pedagógica entre otros. \nPor otro lado, es necesario que los procesos de apropiación y formación a los docentes y directivos docentes vayan mucho más allá de la capacitación para el uso adecuado de una herramienta nueva, ya que, esto limita fuertemente la capacidad del docente para aprovechar efectivamente la nueva disponibilidad de recursos en sus programas y actividades; es necesario que los procesos de formación busquen en primer lugar definir una base común de competencias digitales en la planta docente como punto de partida, pero también que sean procesos pertinentes para los contextos territoriales, en vez de una formación estándar que muchas veces resulta ajena a las realidades en las cuales se implementa. Una ruta de formación efectiva deberá garantizar un nivel mínimo de competencias digitales que permitan mantener la continuidad de la prestación del servicio educativo, aún en contextos atípicos como la prestación en modalidades no presenciales durante la pandemia del COVID19.\nAdemás, será necesario que los docentes y directivos docentes incorporen capacidades relacionadas con las nuevas herramientas y recursos tecnológicos para integrarlos al diseño de sus currículos; competencias en robótica, programación, optimización, pensamiento de diseño y aulas virtuales, entre otros, serán claves para la transformación del papel del docente como parte del proceso formativo, y de la dinámica misma de los procesos de enseñanza y aprendizaje. Además, las inversiones deberán ser sostenibles y permitir el desarrollo de una capacidad instalada, que no esté atada al ejercicio de un docente en particular; por esta razón, la formación también debe generar elementos de gestión institucional que permitan a la comunidad educativa participar de manera activa en los procesos de diagnóstico y reformulación continua de los Proyectos Educativos Institucionales -PEI, de manera que esas iniciativas se institucionalicen efectivamente en las apuestas académicas y pedagógicas de los establecimientos educativos en el corto, mediano y largo plazo.\nEn reconocimiento de lo anterior, el Plan Decenal de Educación 2016 – 2026 elaborado por el Ministerio de Educación Nacional (2016) a partir de ejercicios participativos con la comunidad establece diez desafíos estratégicos para la educación en Colombia, el sexto desafío plantea el uso pertinente, pedagógico y generalizado de las nuevas y diversas tecnologías para apoyar la enseñanza, la construcción de conocimiento, el aprendizaje, la investigación y la innovación, fortaleciendo el desarrollo para la vida. Por otra parte, el Plan Nacional de Desarrollo “Pacto por Colombia, Pacto por la Equidad 2018 – 2022” establece en su Pacto por la Transformación Digital incrementar el acceso a las Tecnologías de la Información y Comunicación – TIC, y desarrollar estrategias que permitan integrar estas tecnologías en los territorios de modo que su uso adecuado permita generar mayor competitividad y desarrollo económico y social (Departamento Nacional de Planeación, 2018). Por su parte, el Ministerio Nacional de Educación presenta en su Plan Estratégico Institucional 2018 – 2022 un conjunto de siete objetivos a lograr en el cuatrienio, siendo el segundo objetivo Brindar una educación con calidad y fomentar la permanencia en la educación inicial, preescolar, básica y media, a través del cual se fomenta procesos de dotación de equipos y herramientas para los establecimientos educativos del país que permitan incrementar la calidad educativa y el acceso por parte de todos los niños, niñas y adolescentes; y se plantean iniciativas para la formación docente para un mejoramiento de los procesos de enseñanza (Ministerio de Educación Nacional, 2019).\nPor otra parte, cabe resaltar la importancia del Plan de Acción para la Transformación Regional (PATR), los cuales consisten en la implementación de una estrategia para la gestión y planificación que permite orientar la ejecución de actividades a realizar al interior de las Agencias de Renovación del Territorio (ART), conforme a los planes y objetivos estipulados en su línea estratégica.  Para el caso del departamento de Putumayo, este instrumento de planificación hace parte de la subregión Putumayo, que comprende los municipios de Leguizamo, Mocoa, Orito, Puerto Asís, Puerto Caicedo, Puerto Guzmán, San Miguel, Valle del Guamuez y Villa Garzón. Dentro de su esquema estratégico, se busca generar una serie de programas y proyectos encaminados a dar solución a situaciones que se han agravado en esta región en el marco del conflicto armado interno colombiano (Renovación del Territorio, 2018). Frente a este panorama, el PATR de la región incluye 8 pilares con los que se busca mejorar las condiciones de vida de los habitantes de estos municipios:\n1.	Ordenamiento social de la propiedad rural y uso del suelo\n2.	Infraestructura y adecuación de tierras\n3.	Salud rural\n4.	Educación rural y primera infancia rural\n5.	Vivienda rural, agua potable y saneamiento básico rural \n6.	Reactivación económica y producción agropecuaria\n7.	Sistema para la garantía progresiva del derecho a la alimentación\n8.	Reconciliación, convivencia y construcción de paz \nEn el marco de los PATR el proyecto contribuye al desarrollo de una iniciativa de la fase municipal del municipio de Valle del Guamuez perteneciente al pilar Educación rural y primera infancia rural, esta iniciativa se encuentran en la estrategia Cobertura, calidad y pertinencia de educación rural para preescolar, básica y media. De acuerdo con la naturaleza del proyecto, de acuerdo con su alcance, el proyecto se articula con la iniciativa: “Dotar de herramientas tecnológicas a los establecimientos educativos del sector rural en el municipio de Valle del Guamuez, departamento del Putumayo”.\n', NULL, 'Estrategia plan nacional de desarrollo 2018-2022 “Pacto por Colombia, pacto por la equidad”.\nPrograma: 2201- Calidad, cobertura y fortalecimiento de la educación inicial, prescolar, básica y media.\nPacto: 3003 - III. Pacto por la equidad: política social moderna centrada en la familia, eficiente, de calidad y conectada a mercados.\nLínea: 300303 - 3. Educación de calidad para un futuro con oportunidades para todos.\n', NULL, 'Nivel departamental\nEstrategia Plan de desarrollo departamental 2020 – 2023 “Trece municipios un solo corazón”.\nLínea estratégica: Social\nSector: Educación \nPrograma: Calidad educativa\nObjetivo: Mejorar la calidad del servicio educativo en educación escolar, básica y media.\n', NULL, '\nNivel municipal\nEstrategia Plan de desarrollo territorial 2020-2023 “Valleguamuenses somos todos”.\nPrograma: Calidad, cobertura y fortalecimiento de la educación inicial, preescolar, básica, media y superior.\nProducto: Infraestructura educativa dotada\nIndicador: Dispositivos tecnológicos gestionados.\n', 'Aumentar la capacidad instalada en competencias digitales para llevar a cabo los procesos de enseñanza y aprendizaje en Establecimientos Educativos Oficiales de la zona rural del municipio de Valle del Guamuez.', 'Objetivos específicos No. 1.\nAumentar el acceso a recursos tecnológicos adecuados en los establecimientos educativos oficiales.\nObjetivo específico No.2.\nFortalecer las competencias digitales para la innovación educativa de docentes y directivos docentes.\n', 'Producto No. 1. \nInfraestructura educativa dotada.\nProducto No. 2. \nServicios de fortalecimiento a las capacidades de los docentes de educación inicial, preescolar, básica y media.\n', '4,779,578,567.00', 'Fortalecimiento de capacidades digitales educativas en la zona rural del municipio de Valle del Guamuez', 'EDUCACIÓN', 'Este proyecto dotará de herramientas tecnológicas a 50 establecimientos educativos de la zona rural del municipio del Valle del Guamuez, reconociendo que las TICs requieren de procesos de apropiación puesto que ellas no son un fin sino un medio a través del cual se puede lograr un mejoramiento en la calidad educativa, el proyecto, de manera complementaria a la dotación, ofrece un proceso de cualificación certificado al personal docente, para la generación de competencias y aptitudes que permitan la apropiación de las herramientas tecnológicas a dotar; este proceso formativo trae consigo el dominio de nuevas metodologías de enseñanza donde el factor tecnológico juega un rol relevante. Dentro de las herramientas tecnológicas a dotar se tienen: video beam con pantalla, computadores de escritorio con cámara web, computadores portátiles, teclados para portátil, mouses para portátil, bases refrigerantes para portátil, tabletas, auriculares-diademas de comunicaciones, tableros interactivos, impresoras multifuncional, televisores, fotocopiadoras, equipos de audio. \n\nEl proceso formativo que tendrán docentes y directivos docentes permitirá el desarrollo de competencias digitales necesarias para su llevar a cabo procesos de enseñanza en el aula de clase a través de herramientas tecnológicas, se brindará bajo la modalidad de diplomado y tendrá una intensidad horaria de 147 horas. Este diplomado está conformado por 4 módulos y 8 unidades temáticas: Módulo 1. Introducción a las herramientas básicas de computación. Módulo 2. Competencias digitales para la educación del siglo XXI. Módulo 3. Metodologías de enseñanza y aprendizaje para la innovación educativa. Módulo 4. Investigación y generación de conocimiento desde el enfoque STEM (Ciencia, tecnología, ingeniería y matemáticas) / STEAM (Ciencia, tecnología, ingeniería, arte y matemáticas). Este diplomado beneficiará a 175 docentes y directivos docentes de las 50 sedes educativas rurales del municipio de Valle del Guamuez.\n', 'El proyecto será financiado con recursos provenientes del Sistema General de Regalías – SGR, a través del fondo de Asignación para la paz.', 1);

